import React, { useState, useEffect } from 'react';
import Sidebar from '../components/Sidebar';
import Footer from '../components/Footer';
import { parseJwt } from '../utils/jwt';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './AddProductPage.css';

const AddProductPage = () => {
  const [username, setUsername] = useState('');
  const [isAdmin, setIsAdmin] = useState(false);
  const [form, setForm] = useState({
    name: '',
    description: '',
    category: '',
    sku: '',
    barcode: '',
    quantity: '',
    min_stock_level: '10',
    price: '',
    unit: 'adet',
    supplier: '',
    supplier_contact: '',
    tax_rate: '18.00',
    warranty_period: '0',
    tags: '',
    image_url: ''
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      const payload = parseJwt(token);
      setUsername(payload?.username || '');
      setIsAdmin(!!payload?.is_admin);
    }
  }, []);

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async e => {
    e.preventDefault();
    setError(''); setSuccess(''); setLoading(true);
    try {
      const token = localStorage.getItem('token');
      await axios.post('http://localhost:5000/products/add', {
        ...form,
        quantity: Number(form.quantity),
        min_stock_level: Number(form.min_stock_level),
        price: Number(form.price),
        tax_rate: Number(form.tax_rate),
        warranty_period: Number(form.warranty_period)
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setSuccess('Ürün başarıyla eklendi!');
      setTimeout(() => navigate('/products'), 1200);
    } catch (err) {
      setError(err.response?.data?.message || 'Ürün eklenemedi!');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ minHeight: '100vh', background: '#f4f6fa', display: 'flex' }}>
      <Sidebar username={username} isAdmin={isAdmin} />
      <div style={{ marginLeft: 200, flex: 1, minHeight: '100vh', display: 'flex', flexDirection: 'column' }}>
        <div style={{ flex: 1, display: 'flex', alignItems: 'flex-start', justifyContent: 'center', padding: '20px' }}>
          <div className="add-product-container">
            <div className="add-product-title">Ürün Ekle</div>
            <form className="add-product-form" onSubmit={handleSubmit}>
              <div className="form-section">
                <h3 className="section-title">Temel Bilgiler</h3>
                <input
                  name="name"
                  placeholder="Ürün Adı *"
                  value={form.name}
                  onChange={handleChange}
                  required
                  className="add-product-input"
                />
                <textarea
                  name="description"
                  placeholder="Ürün Açıklaması"
                  value={form.description}
                  onChange={handleChange}
                  className="add-product-textarea"
                  rows="3"
                />
                <input
                  name="category"
                  placeholder="Kategori"
                  value={form.category}
                  onChange={handleChange}
                  className="add-product-input"
                />
              </div>

              <div className="form-section">
                <h3 className="section-title">Stok ve Fiyat</h3>
                <div className="input-row">
                  <input
                    name="quantity"
                    type="number"
                    placeholder="Miktar *"
                    value={form.quantity}
                    onChange={handleChange}
                    required
                    min={0}
                    className="add-product-input"
                  />
                  <select
                    name="unit"
                    value={form.unit}
                    onChange={handleChange}
                    className="add-product-select"
                  >
                    <option value="adet">Adet</option>
                    <option value="kg">Kilogram</option>
                    <option value="lt">Litre</option>
                    <option value="mt">Metre</option>
                    <option value="paket">Paket</option>
                    <option value="kutu">Kutu</option>
                  </select>
                </div>
                <input
                  name="price"
                  type="number"
                  step="0.01"
                  placeholder="Fiyat (₺) *"
                  value={form.price}
                  onChange={handleChange}
                  required
                  min={0}
                  className="add-product-input"
                />
                <input
                  name="min_stock_level"
                  type="number"
                  placeholder="Minimum Stok Seviyesi"
                  value={form.min_stock_level}
                  onChange={handleChange}
                  min={0}
                  className="add-product-input"
                />
              </div>

              <div className="form-section">
                <h3 className="section-title">Ürün Kodu</h3>
                <input
                  name="sku"
                  placeholder="SKU (Stok Kodu)"
                  value={form.sku}
                  onChange={handleChange}
                  className="add-product-input"
                />
                <input
                  name="barcode"
                  placeholder="Barkod"
                  value={form.barcode}
                  onChange={handleChange}
                  className="add-product-input"
                />
              </div>

              <div className="form-section">
                <h3 className="section-title">Tedarikçi Bilgileri</h3>
                <input
                  name="supplier"
                  placeholder="Tedarikçi Adı"
                  value={form.supplier}
                  onChange={handleChange}
                  className="add-product-input"
                />
                <input
                  name="supplier_contact"
                  placeholder="Tedarikçi İletişim"
                  value={form.supplier_contact}
                  onChange={handleChange}
                  className="add-product-input"
                />
              </div>

              <div className="form-section">
                <h3 className="section-title">Vergi ve Garanti</h3>
                <div className="input-row">
                  <input
                    name="tax_rate"
                    type="number"
                    step="0.01"
                    placeholder="KDV Oranı (%)"
                    value={form.tax_rate}
                    onChange={handleChange}
                    min={0}
                    max={100}
                    className="add-product-input"
                  />
                  <input
                    name="warranty_period"
                    type="number"
                    placeholder="Garanti Süresi (Ay)"
                    value={form.warranty_period}
                    onChange={handleChange}
                    min={0}
                    className="add-product-input"
                  />
                </div>
              </div>

              <div className="form-section">
                <h3 className="section-title">Ek Bilgiler</h3>
                <input
                  name="tags"
                  placeholder="Etiketler (virgülle ayırın)"
                  value={form.tags}
                  onChange={handleChange}
                  className="add-product-input"
                />
                <input
                  name="image_url"
                  type="url"
                  placeholder="Ürün Resmi URL"
                  value={form.image_url}
                  onChange={handleChange}
                  className="add-product-input"
                />
              </div>

              <button
                type="submit"
                disabled={loading}
                className="add-product-button"
              >
                {loading ? 'Ekleniyor...' : 'Ürün Ekle'}
              </button>
              {error && <div className="add-product-error">{error}</div>}
              {success && <div className="add-product-success">{success}</div>}
            </form>
          </div>
        </div>
        <Footer />
      </div>
    </div>
  );
};

export default AddProductPage;
